import axios from "axios";
import React from "react";
import { useNavigate } from "react-router-dom";
import Resultado from "./Resultado";

class Home extends React.Component {
  constructor(props) {
    super(props);
    this.state = { resultado: {}, evento: {} };
  }

  changeHandler = (e) => {
    const el = e.target;
    this.setState({
      [el.name]: el.type === "file" ? el.files[0] : el.value,
    });
  };

  submitImg = (e) => {
    e.preventDefault();

    const bodyFormData = new FormData(e.target);
    this.setState({ evento: bodyFormData });
    this.mandaleAxios(bodyFormData);

    /*return axios
      .post("http://127.0.0.1:8000/detectar-objeto", bodyFormData)
      .then((result) => {
        this.guardarData(result);
      })
      .catch((error) => {
        console.log("la cagamos");
      });*/
  };

  async mandaleAxios(lacosa) {
    await axios
      .post("http://127.0.0.1:8000/detectar-objeto", lacosa)
      .then((result) => {
        this.guardarData(result);
      })
      .catch((error) => {
        console.log("la cagamos");
      });
  }

  guardarData(result) {
    this.setState({ resultado: result }, () => {
      console.log(this.state);
    });
  }

  render() {
    return (
      <body>
        <h2>Detectar Objeto</h2>

        <form
          onSubmit={this.submitImg}
          encType="multipart/form-data"
          onChange={(e) => this.changeHandler(e)}
        >
          <input type="file" name="img1" />
          <button type="submit">Submit</button>
        </form>
        {Object.keys(this.state.resultado).length > 0 && (
          <React.Fragment>
            <h2> resultado: </h2>
            <p> Elemento detectado: {this.resultado.data.detectado}</p>
            <p> Porcentaje de eficiencia: {this.resultado.data.porcentaje}</p>
          </React.Fragment>
        )}
      </body>
    );
  }
}
export default Home;
